css:
@-moz-document domain(laracasts.com) {
	nav.section.tw-py-2.tw-bg-blue-darkest.tw-hidden {
		display:none;
	}

	.new-nav {
		background-image: linear-gradient(90deg,#3d5873,#2e4469);
	}

	.tw-btn-blue {
		background-color: #506e92;
		color: #fff;
		border-color: #3e5979;
	}

	.tw-btn-blue:hover {
		background-color: #556a7b;
		color: #fff;
		border-color: #3c4c5f;
	}

	.tw-text-grey-dark {
		color: #8795a1;
	}

	.conversation-list-avatar .is-answered {
		background-color: #3c4652;
	}

	.footer-wrap {
		background-image: radial-gradient(circle at 1% 1%,#3d4044,#1e2e52);
	}

	.tw-bg-blue {
		background-color: #364961;
	}

	.hljs-keyword, .hljs-selector-tag, .hljs-literal {
		color: #d281d8;
	}

	.hljs-string, .hljs-bullet {
		color: #7ec699;
	}

	.hljs-title {
		color: #f08d49;
	}

	.hljs-params {
		color: #7ec699
	}

	div.container.tw-flex.tw-mx-auto {
		width: 100% !important;
		max-width: 100% !important;
	}

	.tw-bg-blue-lighter {
		background-color: #495d77;
		color: #fff !important;
	}

	.tw-text-blue {
		color: #495f79;
	}

	a {
		color: #32495d;
	}

	.tw-btn:hover {
		color: #354f6d;
	}
}
